JOIN `ospos_item_quantities` AS `item_quantities` ON `item_quantities`.`item_id` = `items`.`item_id`
WHERE `location_id` = '1'
AND `trans_date` BETWEEN '2010-01-01' AND '2022-11-03 23:59:59'
AND   (
`name` LIKE '%Laptop%' ESCAPE '!'
OR  `item_number` LIKE '%Laptop%' ESCAPE '!'
OR  `items`.`item_id` LIKE '%Laptop%' ESCAPE '!'
OR  `company_name` LIKE '%Laptop%' ESCAPE '!'
OR  `ospos_customer_category`.`category` LIKE '%Laptop%' ESCAPE '!'
 )
AND `items`.`deleted` = 0
AND `items`.`item_type` IN(0, 1, 2)
GROUP BY `items`.`item_id`
 LIMIT 25
